import React, { Component, createContext } from 'react'



function Header(){
  return(
    <div>
     <h2>Carwale</h2>
     <button><img src={'images/carwalelogo.png'} width="30" height="30" /></button>
    <button><img src={'images/locationLogo.png'} width="30" height="30" /></button>
    
  </div>
    
  );

}




export default Header;
